def get_lucid_number(n):
    """
    This function finds a lucid number smaller than or equal to n.

    A lucid number is a positive integer that is the sum of exactly one of its prime divisors.

    Args:
        n: The upper limit for finding the lucid number.

    Returns:
        A lucid number smaller than or equal to n, or None if none is found.
    """

    def is_prime(num):
        """Helper function to check if a number is prime."""
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    for i in range(2, n + 1):
        prime_sum = 0
        for j in range(2, int(i**0.5) + 1):
            if i % j == 0 and is_prime(j):
                prime_sum += j
        if prime_sum == i:
            return i
    return None

